import React from "react";
import { useEffect } from "react";

const Logout=()=>{
    useEffect(()=>{
        fetch('http://localhost/5000/api/auth/logout'),{
            method:"GET",
            headers:{
                accept:"application/json",
                "content-type":"application/json"
            },
            credential:"include"
        }
    })
}
